import React from 'react';
import {
  Box,
  TextField,
  Button,
  IconButton,
  InputAdornment,
  Snackbar,
  Alert
} from '@mui/material';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';
import CloseIcon from '@mui/icons-material/Close';

export default function LoginForm({ onClose, onLoginSuccess }) {
  const [mostrarClave, setMostrarClave] = React.useState(false);
  const [errorLogin, setErrorLogin] = React.useState('');
  const [camposVacios, setCamposVacios] = React.useState({ email: false, password: false });

  const onSubmit = (data) => {
    const email = data.email;
    const password = data.password;

    const nuevosErrores = {
      email: !email,
      password: !password
    };
    setCamposVacios(nuevosErrores);
    if (nuevosErrores.email || nuevosErrores.password) return;

    if (email === 'admin@admin.com' && password === 'admin123') {
      localStorage.setItem('token', 'admin-token');
      localStorage.setItem('token-email', email);
      localStorage.setItem('rol', 'admin');
      if (onLoginSuccess) onLoginSuccess();
      if (onClose) onClose();
      window.dispatchEvent(new Event('storage'));
    } else if (email === 'demo@usuario.com' && password === '1234') {
      localStorage.setItem('token', 'usuario-token');
      localStorage.setItem('token-email', email);
      localStorage.setItem('rol', 'usuario');
      if (onLoginSuccess) onLoginSuccess();
      if (onClose) onClose();
      window.dispatchEvent(new Event('storage'));
    } else {
      setErrorLogin('Usuario o contraseña incorrectos');
    }
  };

  return (
    <Box
      component="form"
      onSubmit={(e) => {
        e.preventDefault();
        onSubmit({
          email: e.target.email?.value.trim(),
          password: e.target.password?.value.trim()
        });
      }}
      noValidate
      sx={{
        width: 350,
        bgcolor: '#fff',
        p: 4,
        borderRadius: 3,
        boxShadow: '0 8px 24px rgba(56,142,60,0.3)',
        display: 'flex',
        flexDirection: 'column',
        gap: 2,
        position: 'relative',
        fontFamily: "'Segoe UI', sans-serif"
      }}
    >
      {/* Botón cerrar flotante */}
      <IconButton
        onClick={onClose}
        size="small"
        sx={{
          position: 'absolute',
          top: 12,
          right: 12,
          color: '#388e3c',
          zIndex: 2
        }}
      >
        <CloseIcon />
      </IconButton>

      {/* Campos */}
      <TextField
        name="email"
        label="Correo electrónico"
        type="email"
        fullWidth
        autoFocus
        autoComplete="username"
        variant="outlined"
        error={camposVacios.email}
        helperText={camposVacios.email ? 'Este campo es obligatorio' : ''}
        sx={{
          '& label.Mui-focused': { color: '#4caf50' },
          '& .MuiOutlinedInput-root': {
            '&.Mui-focused fieldset': {
              borderColor: '#4caf50'
            }
          }
        }}
      />

      <TextField
        name="password"
        label="Contraseña"
        type={mostrarClave ? 'text' : 'password'}
        fullWidth
        autoComplete="current-password"
        variant="outlined"
        error={camposVacios.password}
        helperText={camposVacios.password ? 'Este campo es obligatorio' : ''}
        InputProps={{
          endAdornment: (
            <InputAdornment position="end">
              <IconButton
                onClick={() => setMostrarClave(!mostrarClave)}
                edge="end"
                sx={{ color: '#4caf50' }}
              >
                {mostrarClave ? <VisibilityOffIcon /> : <VisibilityIcon />}
              </IconButton>
            </InputAdornment>
          )
        }}
        sx={{
          '& label.Mui-focused': { color: '#4caf50' },
          '& .MuiOutlinedInput-root': {
            '&.Mui-focused fieldset': {
              borderColor: '#4caf50'
            }
          }
        }}
      />

      {/* Botón */}
      <Button
        type="submit"
        variant="contained"
        fullWidth
        sx={{
          background: 'linear-gradient(to right, #66bb6a, #43a047)',
          color: '#fff',
          fontWeight: 'bold',
          paddingY: 1.2,
          borderRadius: 2,
          '&:hover': {
            background: 'linear-gradient(to right, #81c784, #388e3c)'
          }
        }}
      >
        ENTRAR
      </Button>

      {/* Registro */}
      <Button
        href="/registro"
        variant="text"
        fullWidth
        sx={{ color: '#4caf50', textDecoration: 'underline', fontWeight: 'bold' }}
      >
        ¿No tienes cuenta? Regístrate aquí
      </Button>

      {/* Error */}
      <Snackbar
        open={!!errorLogin}
        autoHideDuration={4000}
        onClose={() => setErrorLogin('')}
        anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}
      >
        <Alert severity="error" variant="filled" onClose={() => setErrorLogin('')}>
          {errorLogin}
        </Alert>
      </Snackbar>
    </Box>
  );
}
